import HeaderComponent from "./header.js";
import "../styles/BookFlight.css";

function BookFlight() {
  return (
    <div>
      <HeaderComponent />
      
      <div className="bookflight-container">
        <div className="bookflight-inputs">
          <label className="bookflight-label">EMAIL</label>
          <input className="bookflight-input" type="email" placeholder="example@test.com" />
          <label className="bookflight-label">PASSWORD</label>
          <input className="bookflight-input" type="password" placeholder="Min 6 characters long" />
          <button className="bookflight-button" type="submit">LOGIN</button>
        </div>
      </div>
    </div>
  );
}

export default BookFlight;
